import React, { Fragment, useState } from "react";
import { NavLink } from "react-router-dom";
import "../css/header.css";
import logo from "../brainster_space_logo.svg";

const Header = () => {
  const [menu, setMenu] = useState(true);
  const showMenu = () => {
    setMenu(!menu);
  };
  return (
    <Fragment>
      <div className="header">
        <div className="l-l">
          <NavLink to="/">
            <div className="logo">
              <img src={logo}></img>
            </div>
          </NavLink>
          <div className={menu ? "navs navs-mobile" : "d-none"}>
            <ul>
              <NavLink to="/space-blog">
                <li>SPACE БЛОГ</li>
              </NavLink>
              <li>НАСТАНИ</li>
              <li>CO-WORKING</li>
              <NavLink to="/akademii">
                <li>АКАДЕМИИ</li>
              </NavLink>
              <NavLink to="/prostor-za-nastani">
                <li>ПРОСТОР ЗА НАСТАНИ</li>
              </NavLink>
              <li>ПАРТНЕРСТВА</li>
            </ul>
          </div>
        </div>
        <div className="prikluci">
          <ul>
            <NavLink to="/form">
              <li>
                <span>
                  <i class="fa fa-plus" aria-hidden="true"></i>
                </span>
                ПРИКЛУЧИ СЕ
              </li>
            </NavLink>
          </ul>
        </div>
        <div className="menu-hamburger" onClick={showMenu}>
          <i class="fa fa-bars" aria-hidden="true"></i>
        </div>
      </div>
    </Fragment>
  );
};

export default Header;
